import React from 'react';
import Grid from '@material-ui/core/Grid';
import styled from 'styled-components';

const Info = (props) => {

    const Wrapper = styled(Grid)`
        background-image: url(${props.icon});
        height: 100px;
        width: 400px;
    `;

    return (
        <Wrapper container>
            <h3>{props.title}</h3>
        </Wrapper>
    );

};

export default Info;
